import React, {useContext, useReducer, useState} from 'react';
import CaiContext from './CaiContext';
import CaiReducer from './CaiReducer';
import './App.css';
import CaiButton from './components/CaiButton/CaiButton';


function App() {
    const initialState = useContext(CaiContext);
    const [state, dispatch] = useReducer(CaiReducer, initialState, undefined);
    const [isDialogOpen, toggleDialog] = useState(false);
      return (
          <CaiContext.Provider value={{state, dispatch}}>
            <div className="App">
                {!isDialogOpen ?
              <CaiButton buttonValue="Features Table" onClickButton={() => {toggleDialog(!isDialogOpen)}}/>
                    : <div></div>}
            </div>
          </CaiContext.Provider>
      );
}

export default App;
